import React, { Component } from "react";

class Courses extends Component {
  render() {
    return (
      <div>
        <h2>COURSES</h2>
        <p>Mentee courses will be listed here</p>
        <ol>
          <li>Math</li>
          <li>Science</li>
          <li>Engeeniering</li>
          <li>Arts</li>
          <li>Computing</li>
        </ol>
      </div>
    );
  }
}

export default Courses;
